// YAMAHA icons with theme variants
const yamahaIcons: Record<string, IconEntry> = {
  'rtx3510': { default: `<svg viewBox="0 0 166 48" width="100%" height="100%"><image href="data:image/png;base64," width="166" height="48" preserveAspectRatio="xMidYMid meet"/></svg>` },
}

// Map DeviceType to icon key
const deviceTypeToIcon: Record<DeviceType, string> = {
  [DeviceType.Router]: 'router',
  [DeviceType.L3Switch]: 'l3-switch',
  [DeviceType.L2Switch]: 'l2-switch',
  [DeviceType.Firewall]: 'firewall',
  [DeviceType.LoadBalancer]: 'load-balancer',
  [DeviceType.Server]: 'server',
  [DeviceType.AccessPoint]: 'access-point',
  [DeviceType.Cloud]: 'cloud',
  [DeviceType.Internet]: 'internet',
  [DeviceType.VPN]: 'vpn',
  [DeviceType.Database]: 'database',
  [DeviceType.Generic]: 'generic',
}

// All vendor icon sets for dynamic lookup
const vendorIconSets: Record<string, Record<string, IconEntry>> = {
  'aws': awsIcons,
  'yamaha': yamahaIcons,
}

/**
 * Get SVG icon content for a device type (backward compatible)
 * @param type - Device type
 * @param _vendor - Optional vendor name (unused, for backward compatibility)
 */
export function getDeviceIcon(type?: DeviceType, _vendor?: string): string | undefined {
  if (!type) return undefined
  const iconKey = deviceTypeToIcon[type]
  if (!iconKey) return undefined
  return defaultIcons[iconKey]
}

/**
 * Get icon by vendor, service, and optional resource
 * @param vendor - Vendor name ('aws', 'yamaha', 'default', etc.)
 * @param service - Service/model name (e.g., 'ec2', 'vpc', 'rtx3510')
 * @param resource - Resource name (optional, e.g., 'instance', 'nat-gateway')
 * @param theme - Theme variant ('light', 'dark', or 'default')
 */
export function getVendorIcon(
  vendor: string,
  service: string,
  resource?: string,
  theme: IconThemeVariant = 'default'
): string | undefined {
  if (vendor === 'default' || !vendor) {
    return defaultIcons[service] || (resource ? defaultIcons[resource] : undefined)
  }

  // Look up vendor icon set
  const vendorIcons = vendorIconSets[vendor]
  if (!vendorIcons) return undefined

  const key = resource ? `${service}/${resource}` : service
  const entry = vendorIcons[key]
  if (!entry) {
    // Try to find a partial match (service-level icon)
    const serviceKey = Object.keys(vendorIcons).find(k => k.startsWith(service + '/'))
    if (serviceKey) {
      const serviceEntry = vendorIcons[serviceKey]
      return serviceEntry[theme] || serviceEntry.default
    }
    return undefined
  }
  return entry[theme] || entry.default
}

export const iconSets = {
  default: defaultIcons,
  aws: awsIcons,
  yamaha: yamahaIcons,
}
